import { Box, Button, TextField, Typography } from '@mui/material'
import React, { useState } from 'react'

const Auth = () => {
  const [isSignUp, setIsSignUp] = useState(false)
  return (
     <form>
         <Box maxWidth={400} display='flex' flexDirection={'column'} alignItems='center' justifyContent={'center'} boxShadow='10px 10px 20px #ccc' padding={3} margin='auto' marginTop={5} borderRadius={5}>
            <Typography variant='h2' padding={3} textAlign='center'>Login Section</Typography>
           {isSignUp && <TextField placeholder='Name' margin='normal'/>}
            <TextField placeholder='Email' type={'email'}margin='normal'/>
            <TextField placeholder='password' type={'password'}margin='normal'/>
           
      <Button variant='contained' sx={{borderRadius:3,marginTop:3}} color='warning'>Login</Button>
      <Button onClick={()=>setIsSignUp(!isSignUp)} sx={{borderRadius:3,marginTop:3}}>Go to SignUp {isSignUp ? "Login":"SignUP"}</Button>
         </Box>
     </form>
  )
}

export default Auth
